INSERT INTO `node` (`nid`, `vid`, `type`, `language`, `title`, `uid`, `status`, `created`, `changed`, `comment`, `promote`, `moderate`, `sticky`, `tnid`, `translate`) VALUES
(17, 17, 'timeline', '', 'URGENTE: El ex-Gobernador de las Islas Malvinas, Rex Hunt, acaba de aterrizar en Londres (FOTO) ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(18, 18, 'timeline', '', 'En estos momentos: Tanques argentinos se trasladan por las calles de Puerto Argentino ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(19, 19, 'timeline', '', 'Ayer en La Razón &gt; El Jockey Club evoca el centenario de su fundación en momentos históricos para la Patria #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(20, 20, 'timeline', '', 'El Jefe del Estado Mayor, Vaquero, arribó a Malvinas para interiorizarse acerca de las necesidades de las tropas argentinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(21, 21, 'timeline', '', 'Comandante de brigada, Américo Daher, restó importancia al bloqueo naval. "el problema lo van a tener ellos; no saben lo que les espera"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(22, 22, 'timeline', '', 'Según estimaciones, esta medida redoblará el número de "Harrier" (aviones de despegue vertical) en el Atlántico Sur', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(23, 23, 'timeline', '', 'Gran Bretaña anunció que requisó otro buque mercante para reforzar la "Task Force". Transportará aviones "Harrier"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(24, 24, 'timeline', '', 'Urgente: Costa Méndez declaró que las negociaciones con UK siguen vigentes pero "no se registraron progresos"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(25, 25, 'timeline', '', 'En nuestro sitio, una selección de los temas más importantes de la semana (8 al 14 de abril) &gt;&gt;  #1982', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(26, 26, 'timeline', '', 'Hoy en La Nación &gt; Argentina sostiene que el cese de hostilidades está quebrado por Gran Bretaña #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(27, 27, 'timeline', '', 'Gob de Costa Rica reiteró su "reconocimiento y apoyo a los derechos soberanos de la Argentina sobre las islas Malvinas"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(28, 28, 'timeline', '', 'Se intensificó puente aéreo e/ Malvinas y aeropuertos de C. Rivadavia y Río Gallegos. La Armada mantiene el control sobre el Mar Argentino', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(29, 29, 'timeline', '', 'Canciller brasileño afirmó que no aceptarán sugerencia de Thatcher para influenciar a Arg y obtener retiro de tropas de Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(30, 30, 'timeline', '', 'APOYO: ante posibles hostilidades, Panamá convocó al Consejo de Seguridad para "detener la agresión contra la Argentina"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(31, 31, 'timeline', '', 'Por una solución pacífica: Haig anunció que mañana viajará a BsAs', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(32, 32, 'timeline', '', 'Oficial: la Comunidad Económica Europea acordó prohibir la importación de productos argentinos durante un mes a partir de 16/04', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(33, 33, 'timeline', '', 'Hoy en Diario Popular &gt; Cien mil hombres en pie de guerra. Las Malvinas son "una fortaleza inexpulgable" #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(34, 34, 'timeline', '', 'Hoy en Río Negro &gt; Haig informa hoy a Reagan y después viajaría a Buenos Aires #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(35, 35, 'timeline', '', 'Soldado argentino transportando su equipo, esta tarde en Puerto Argentino (FOTO) ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(36, 36, 'timeline', '', 'Hoy en La Nación &gt; Haig suspendió su regreso a nuestro país. #Malvinas atraviesa un punto extremadamente grave #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(37, 37, 'timeline', '', 'Argentina no cesará las compras a la CEE. Secretario de Comercio afirmó que "Mientras se puedan sustituir se sustituirán"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(38, 38, 'timeline', '', 'La Unión Soviética defendió a la Argentina y acusó a la Comunidad Económica Europea por "violación del derecho internacional"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(39, 39, 'timeline', '', 'Noruega y Suecia no se unirán al embargo de las importaciones de la Argentina acordado por la Comunidad Económica Europea', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(40, 40, 'timeline', '', 'Comandante en Jefe de la Fuerza Aérea Arg confía en encontrar solución diplomática y se prepara para enfrentar "cualquier eventualidad"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(41, 41, 'timeline', '', 'Partiendo del "reconocimiento de que las Malvinas pertenecen a la Argentina", el presidente panameño Arístides Royo ratificó su APOYO', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(42, 42, 'timeline', '', 'Vocero UK: "La fuerza naval de intervención (Task Force) sigue avanzando hacia los archipiélagos con la misión de reconquistarlos"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(43, 43, 'timeline', '', 'URGENTE: tras anuncio de Haig, Margaret Thatcher aseguró que la gestión estadounidense "había fracasado"', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(44, 44, 'timeline', '', 'Alexander Haig retorna a Londres. Afirma tener "nuevas ideas" para una solución pacífica del conflicto por Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(45, 45, 'timeline', '', 'El embajador argentino en la ONU, Eduardo Roca, ratificó en NY la posición negociadora argentina ante el Consejo de Seguridad', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(46, 46, 'timeline', '', 'Hoy en La Prensa &gt; No retornaría Haig a Buenos Aires. Pesimismo del secretario por la rígida posición británica #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(47, 47, 'timeline', '', 'Hoy en Diario Popular &gt; No bajamos la guardia. La OEA rechazó un proyecto para condenar la posición argentina #1982 ', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(48, 48, 'timeline', '', 'Fuentes castrenses aseguraron que LA PROPUESTA FUE RECHAZADA', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(49, 49, 'timeline', '', 'Haig comunicó una contrapropuesta aprobada por UK:  gobierno tripartito para las islas entre Argentina, Gran Bretaña y Estados Unidos', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(50, 50, 'timeline', '', 'Haig acaba de comunicarse telefónicamente con Costa Méndez. No retornará a BsAs debido a que UK rechazó la propuesta argentina', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(51, 51, 'timeline', '', 'Representantes de Ecuador, México y Perú transmitieron su solidaridad con la causa argentina en la recuperación de las Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(52, 52, 'timeline', '', 'El consejo de presidentes de la Multipartidaria ratificó el APOYO a las Fuerzas Armadas en cuanto a la recuperación de las Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(53, 53, 'timeline', '', 'HISTÓRICO: países latinoamericanos defienden a la Argentina y se levantó la sesión del Consejo de la OEA, celebrada en Washington', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(54, 54, 'timeline', '', 'Costa Méndez declaró que no hubo avances en la búsqueda de una solución pacífica con Gran Bretaña por las islas Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(55, 55, 'timeline', '', 'Por Malvinas, Margaret Thatcher convocó a una sesión extraordinaria de la Cámara de los Comunes para el día 14/04', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(56, 56, 'timeline', '', 'En caso de conflicto, Bolivia brindará APOYO armado y logístico a la Arg comunicó el comandante de la Fuerza Aérea Boliviana', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
(57, 57, 'timeline', '', 'Canadá responde a Gran Bretaña prohibiendo las importaciones de productos argentinos como represalia por la ocupación de las Malvinas', 0, 1, 1334517779, 1334517779, 0, 0, 0, 0, 0, 0),
