INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES
(17, 17, 1, 'URGENTE: El ex-Gobernador de las Islas Malvinas, Rex Hunt, acaba de aterrizar en Londres (FOTO) ', '', '', '', 1334517779, 0),
(28, 28, 1, 'Se intensificó puente aéreo e/ Malvinas y aeropuertos de C. Rivadavia y Río Gallegos. La Armada mantiene el control sobre el Mar Argentino', '', '', '', 1334517779, 0),
(29, 29, 1, 'Canciller brasileño afirmó que no aceptarán sugerencia de Thatcher para influenciar a Arg y obtener retiro de tropas de Malvinas', '', '', '', 1334517779, 0),
(30, 30, 1, 'APOYO: ante posibles hostilidades, Panamá convocó al Consejo de Seguridad para "detener la agresión contra la Argentina"', '', '', '', 1334517779, 0),
(31, 31, 1, 'Por una solución pacífica: Haig anunció que mañana viajará a BsAs', '', '', '', 1334517779, 0),
(32, 32, 1, 'Oficial: la Comunidad Económica Europea acordó prohibir la importación de productos argentinos durante un mes a partir de 16/04', '', '', '', 1334517779, 0),
(33, 33, 1, 'Hoy en Diario Popular &gt; Cien mil hombres en pie de guerra. Las Malvinas son "una fortaleza inexpulgable" #1982 ', '', '', '', 1334517779, 0),
(18, 18, 1, 'En estos momentos: Tanques argentinos se trasladan por las calles de Puerto Argentino ', '', '', '', 1334517779, 0),
(19, 19, 1, 'Ayer en La Razón &gt; El Jockey Club evoca el centenario de su fundación en momentos históricos para la Patria #1982 ', '', '', '', 1334517779, 0),
(20, 20, 1, 'El Jefe del Estado Mayor, Vaquero, arribó a Malvinas para interiorizarse acerca de las necesidades de las tropas argentinas', '', '', '', 1334517779, 0),
(21, 21, 1, 'Comandante de brigada, Américo Daher, restó importancia al bloqueo naval. "el problema lo van a tener ellos; no saben lo que les espera"', '', '', '', 1334517779, 0),
(22, 22, 1, 'Según estimaciones, esta medida redoblará el número de "Harrier" (aviones de despegue vertical) en el Atlántico Sur', '', '', '', 1334517779, 0),
(23, 23, 1, 'Gran Bretaña anunció que requisó otro buque mercante para reforzar la "Task Force". Transportará aviones "Harrier"', '', '', '', 1334517779, 0),
(24, 24, 1, 'Urgente: Costa Méndez declaró que las negociaciones con UK siguen vigentes pero "no se registraron progresos"', '', '', '', 1334517779, 0),
(25, 25, 1, 'En nuestro sitio, una selección de los temas más importantes de la semana (8 al 14 de abril) &gt;&gt;  #1982', '', '', '', 1334517779, 0),
(26, 26, 1, 'Hoy en La Nación &gt; Argentina sostiene que el cese de hostilidades está quebrado por Gran Bretaña #1982 ', '', '', '', 1334517779, 0),
(27, 27, 1, 'Gob de Costa Rica reiteró su "reconocimiento y apoyo a los derechos soberanos de la Argentina sobre las islas Malvinas"', '', '', '', 1334517779, 0),
(34, 34, 1, 'Hoy en Río Negro &gt; Haig informa hoy a Reagan y después viajaría a Buenos Aires #1982 ', '', '', '', 1334517779, 0),
(35, 35, 1, 'Soldado argentino transportando su equipo, esta tarde en Puerto Argentino (FOTO) ', '', '', '', 1334517779, 0),
(36, 36, 1, 'Hoy en La Nación &gt; Haig suspendió su regreso a nuestro país. #Malvinas atraviesa un punto extremadamente grave #1982 ', '', '', '', 1334517779, 0),
(37, 37, 1, 'Argentina no cesará las compras a la CEE. Secretario de Comercio afirmó que "Mientras se puedan sustituir se sustituirán"', '', '', '', 1334517779, 0),
(38, 38, 1, 'La Unión Soviética defendió a la Argentina y acusó a la Comunidad Económica Europea por "violación del derecho internacional"', '', '', '', 1334517779, 0),
(39, 39, 1, 'Noruega y Suecia no se unirán al embargo de las importaciones de la Argentina acordado por la Comunidad Económica Europea', '', '', '', 1334517779, 0),
